(1,'Fundos Imobiliários','<div class=\"lp-element lp-pom-root\" id=\"lp-pom-root\"><div id=\"lp-pom-root-color-overlay\"></div><div class=\"lp-positioned-content\"><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-13\" style=\"height: auto;\"><p style=\"text-align: center; line-height: 32px;\"><span style=\"font-family: Rubik; font-weight: 700; font-style: normal; color: rgb(255, 255, 255); font-size: 36px;\">Sumário</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-14\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-family: &quot;Source Sans Pro&quot;; font-weight: 400; font-style: normal; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Já pensou em virar dono de grandes empreendimentos? Com os fundos imobiliários, isso é possível!</span><br><span style=\"font-family: &quot;Source Sans Pro&quot;; font-weight: 400; font-style: normal; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">&nbsp;<br>Nessa modalidade de investimento, você possui as mesmas vantagens da compra de um imóvel, porém consegue investir com baixo valor inicial, sem burocracias e com muito menos custos.</span><br><span style=\"font-family: &quot;Source Sans Pro&quot;; font-weight: 400; font-style: normal; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br>Neste e-book, vamos ensinar o que são os fundos imobiliários, os tipos, suas vantagens e como investir neles.&nbsp;</span><br><span style=\"font-family: &quot;Source Sans Pro&quot;; font-weight: 400; font-style: normal; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br>Lembre-se, conhecimento e informação são peças-chave que devem ser acumuladas, assim como o nosso patrimônio.&nbsp;</span><br><br><span style=\"font-family: &quot;Source Sans Pro&quot;; font-weight: 400; font-style: normal; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Boa leitura!</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-74\" style=\"height: auto;\"><p style=\"line-height: 77px;\"><span style=\"font-weight: 700; font-family: Rubik; font-size: 72px; color: rgb(0, 243, 255);\"><span style=\"font-style: normal;\"><strong>Fundos Imobiliários 2.0</strong></span></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-75\" style=\"height: auto;\"><p style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 36px; color: rgb(255, 255, 255); font-style: normal;\">O Guia Completo</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-115\" style=\"height: auto;\"><p style=\"line-height: 24px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); font-style: normal;\">O que são Fundos Imobiliários (FIIs)?</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-122\" style=\"height: auto;\"><p style=\"line-height: 24px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); font-style: normal;\">Como funcionam os FIIs</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-130\" style=\"height: auto;\"><p style=\"line-height: 24px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); font-style: normal;\">Como investir? Saiba duas formas</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-135\" style=\"height: auto;\"><p style=\"line-height: 24px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); font-style: normal;\">Vantagens dos fundos imobiliários</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-141\" style=\"height: auto;\"><p style=\"line-height: 24px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); font-style: normal;\">Os principais tipos de fundos imobiliários</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-155\" style=\"height: auto;\"><p style=\"line-height: 24px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); font-style: normal;\">Mercado de Fundos Imobiliários volta a se aquecer</span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-171\"><span class=\"label\"><strong>01</strong></span></a><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-177\"><span class=\"label\"><strong>02</strong></span></a><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-179\"><span class=\"label\"><strong>03</strong></span></a><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-180\"><span class=\"label\"><strong>04</strong></span></a><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-183\"><span class=\"label\"><strong>05</strong></span></a><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-184\"><span class=\"label\"><strong>06</strong></span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-209\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os fundos de investimentos imobiliários, ou simplesmente fundos imobiliários, são fundos que investem em imóveis e/ou títulos de renda fixa lastreados em imóveis. Esses fundos investem, de forma geral, em imóveis comerciais e corporativos, como shopping centers, lajes corporativas de alto padrão, hotéis e galpões industriais.<br><br>Em geral, esses imóveis têm como inquilinos grandes empresas. Nada impede que fundos imobiliários invistam em imóveis residenciais, por exemplo, mas esse modelo não é comum no Brasil. Fundos que investem em imóveis diretamente, em geral, podem lançar mão de dois tipos de estratégia: compra e venda para ganhar com a valorização dos imóveis ou aluguel para inquilinos de alta qualidade. Além de combinar os dois modelos.<br><br>Existem, porém, fundos imobiliários que não investem em imóveis diretamente. Há aqueles que apenas compram cotas em outros fundos imobiliários e, também, os que só investem em papéis de renda fixa usados para financiar o mercado imobiliário. Entre esses papéis, o mais comum é o Certificado de Recebíveis Imobiliários (CRI), que dá ao detentor o direito de receber pagamentos de algum tipo de financiamento imobiliário.</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-214\" style=\"height: auto;\"><p style=\"line-height: 58px;\"><span style=\"font-weight: 700; font-family: Rubik; font-size: 72px; color: rgb(0, 243, 255);\"><span style=\"font-style: normal;\"><strong>Fundos Imobiliários 2.0</strong></span></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-215\" style=\"height: auto;\"><p style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 36px; color: rgb(255, 255, 255); font-style: normal;\">O Guia Completo</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-310\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>Como&nbsp;</strong></span><span style=\"color: rgb(61, 165, 253);\"><br><span style=\"font-size: 36px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal;\"><strong>investir?</strong></span><span style=\"font-family: Rubik; font-weight: 400; font-style: