\\)?){6,13}$\"></div><input id=\"traffic_source\" name=\"traffic_source\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"client_id\" name=\"client_id\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"gclid\" name=\"gclid\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"utm_source\" name=\"utm_source\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"utm_medium\" name=\"utm_medium\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"utm_term\" name=\"utm_term\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"utm_campaign\" name=\"utm_campaign\" type=\"hidden\" class=\"hidden\" value=\"\"><input id=\"utm_content\" name=\"utm_content\" type=\"hidden\" class=\"hidden\" value=\"\"></div><button class=\"lp-element lp-pom-button\" id=\"lp-pom-button-569\" type=\"submit\"><span class=\"label\">ABRIR MINHA CONTA</span></button>\r\n<input type=\"hidden\" name=\"ubafs-jev\" id=\"ubafs-jev\" value=\"{&quot;date&quot;:&quot;2021-06-11T00:53:12.999Z&quot;,&quot;agent&quot;:&quot;Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.77 Safari/537.36&quot;,&quot;screen&quot;:{&quot;availWidth&quot;:1920,&quot;availHeight&quot;:1040,&quot;width&quot;:1920,&quot;height&quot;:1080},&quot;window&quot;:{&quot;innerWidth&quot;:1160,&quot;innerHeight&quot;:933},&quot;hasPlugins&quot;:true}\"></form></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-570\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(68, 68, 68); font-style: normal;\"><strong>*campos obrigatórios</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-573\" style=\"height: auto;\"><p style=\"line-height: 34px; text-align: center;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 28px; color: rgb(61, 165, 253);\"><strong>Vem ser Genial.&nbsp;</strong></span><span style=\"color: rgb(61, 165, 253);\"><br><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 28px;\"><strong>Abra sua conta.</strong></span><br></span><span style=\"font-family: Rubik; font-weight: 400; font-style: normal; font-size: 26px; color: rgb(61, 165, 253);\">É simples, rápido e grátis.</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-995\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os fundos de investimentos imobiliário são fechados. Isso significa que eles têm número limitado de cotas e não permitem a entrada e a saída de cotistas livremente. Ao serem constituídos, eles abrem para captação por um período determinado, em que os interessados podem se candidatar a compra de cotas com um preço fixo. <br><br>Terminado o período de captação, cada cotista recebe o número de cotas ao qual se candidatou, não sendo mais aceitos novos cotistas nem novos aportes. Caso o gestor opte por aumentar o patrimônio do fundo por algum motivo – por exemplo, porque ele precisa de mais dinheiro para um novo investimento – ele deve fazer uma nova emissão de cotas com um novo ciclo de captação. <br><br>Os resgates também não são permitidos durante o período de vigência do fundo. Estes só podem ocorrer quando o fundo encerra suas atividades. Para sair do investimento e reaver o valor aplicado, o investidor precisa vender suas cotas para outro interessado. A manobra, aliás, é a única maneira de tornar-se cotista de um fundo fechado ou aumentar a participação fora do período de captação. <br><br>Em outras palavras, em um fundo imobiliário, para adquirir mais cotas fora do período de captação é necessário comprá-las de outro investidor; e para desfazer-se delas durante a vigência do fundo, é preciso vendê-las a outro investidor. <br><br>No caso dos fundos imobiliários, esse processo de compra e venda é facilitado, pois a maior parte dos FIIs tem cotas negociadas em Bolsa de Valores, como se fossem ações. Há um valor mínimo de investimento durante a captação, mas, passado esse período, os valores das cotas podem se valorizar ou desvalorizar no mercado, da mesma forma que ocorre com as ações. Com isso, os valores mínimos de inversão também variam. <br><br>Fundos com perspectiva de bom desempenho podem ser mais procurados pelos investidores, como, por exemplo, os que valorizam as cotas. No entanto, se os cotistas entenderem que o fundo não oferece possibilidades muito boas, ou mesmo se desejarem realizar os lucros após um período de grandes altas, eles podem querer vender suas cotas, o que derrubaria o preço. <br><br>Assim, o valor necessário para comprar cotas de um FII fora do período de captação é igual ao número de cotas que se deseja adquirir multiplicado pelo preço da cota naquele momento. E esse preço pode variar diariamente, podendo ser maior ou menor em relação ao valor mínimo inicial. <br><br>Os rendimentos dos fundos imobiliários costumam ser isentos de imposto de renda para pessoa física, o que funciona como chamariz para o pequeno investidor. A segunda maneira de lucrar é pela valorização da cota. Nesse caso, o ganho é tributado em 20% e a responsabilidade de recolhimento do imposto de renda é do investidor, da mesma forma que ocorre com as ações. <br><br>Mas atenção: assim como é possível ter ganhos com a valorização das cotas, podem ocorrer perdas no caso de uma desvalorização. Ao comprar cotas de um FII, portanto, o investidor deve estar ciente de que só poderá sair do investimento, durante a vigência do fundo, vendendo suas cotas, e o valor de venda dependerá do valor de mercado delas.</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1124\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Para começar a investir em um fundo imobiliário, há duas maneiras: por meio de oferta pública ou pela compra de cotas de outro investidor, processo que, em linhas gerais, costuma ser realizado na Bolsa de Valores.<br>Se o investidor quiser se desfazer de um aporte em fundos imobiliários, basta vender suas cotas a outro investidor interessado.</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1216\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os fundos imobiliários representam uma forma mais fácil e acessível para o pequeno investidor aplicar em imóveis. Há diversas vantagens, como:<br><br></span><span style=\"font-weight: 700; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(12, 11, 56); background-color: rgba(255, 255, 255, 0); font-style: normal;\">INVESTIMENTO INICIAL BAIXO:</span><span style=\"color: rgb(12, 11, 56);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; background-color: rgba(255, 255, 255, 0);\">&nbsp;</span><br></span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Com centenas ou alguns milhares de reais é possível comprar uma fração de um ou mais imóveis. Enquanto isso, o investimento direto em imóveis exigiria juntar centenas de milhares de reais para comprar um único apartamento.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span><span style=\"font-weight: 700; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(12, 11, 56); background-color: rgba(255, 255, 255, 0); font-style: normal;\">DIVERSIFICAÇÃO COM POUCO DINHEIRO:</span><span style=\"color: rgb(12, 11, 56);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; background-color: rgba(255, 255, 255, 0);\">&nbsp;</span><br></span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Ao investir em um fundo imobiliário, o investidor consegue, com poucos recursos, comprar uma carteira já diversificada de imóveis e papéis. Já o investimento direto em imóveis exige que o investidor desembolse milhões de reais para diversificar adequadamente.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span><span style=\"font-weight: 700; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(12, 11, 56); background-color: rgba(255, 255, 255, 0); font-style: normal;\">MENOS BUROCRACIA:</span><span style=\"color: rgb(12, 11, 56);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; background-color: rgba(255, 255, 255, 0);\">&nbsp;</span><br></span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Esqueça papeladas, visitas a imóveis ou inquilinos. Tudo isso pode ser evitado com os fundos imobiliários, uma forma indireta de investir em imóveis e receber aluguéis, sem ter que lidar com problemas externos. Os fundos imobiliários representam uma forma mais fácil e acessível para o pequeno investidor aplicar em imóveis.</span><br><br><span style=\"font-weight: 700; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(12, 11, 56); background-color: rgba(255, 255, 255, 0); font-style: normal;\"> ACESSO A ATIVOS DE QUALIDADE:</span><span style=\"color: rgb(12, 11, 56);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; background-color: rgba(255, 255, 255, 0);\">&nbsp;</span><br></span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os imóveis que compõem a carteira dos fundos imobiliários costumam ser de alto padrão, com inquilinos de qualidade. Esse tipo de investimento costuma ser inacessível à pessoa física, que dificilmente, compraria um edifício corporativo de alto padrão.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span><span style=\"font-weight: 700; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(12, 11, 56); background-color: rgba(255, 255, 255, 0); font-style: normal;\">ISENÇÃO DE IMPOSTO DE RENDA:</span><span style=\"color: rgb(12, 11, 56);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; background-color: rgba(255, 255, 255, 0);\">&nbsp;</span><br></span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os rendimentos pagos pelos fundos imobiliários costumam ser isentos de imposto de renda para a pessoa física. Essa talvez seja a principal vantagem desses fundos para o pequeno investidor. Para ter seus rendimentos isentos de IR, o fundo imobiliário deve, necessariamente, ter cotas negociadas exclusivamente em Bolsa ou mercado de balcão organizado e ter, no mínimo, 50 cotistas. O cotista beneficiado não pode ter mais do que 10% das cotas do fundo. Mas atenção: os lucros obtidos com a venda das cotas na Bolsa são tributados em 20%. Não existe a isenção de IR para vendas de até 20 mil reais mensais, como ocorre para as ações. Mas é possível compensar lucros com prejuízos na venda das cotas.<br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1266\" style=\"height: auto;\"><p style=\"line-height: 31px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(12, 11, 56);\"><strong>Fundos de renda</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1267\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os fundos imobiliários que geram renda são aqueles que compram ou constroem imóveis para alugar. Periodicamente, os cotistas recebem na conta uma quantia referente aos aluguéis. O principal risco dos fundos voltados para aluguel é o risco de vacância. Perder inquilinos evidentemente diminui a renda com aluguel, o que impacta os rendimentos do fundo. Quanto mais vazio o imóvel, pior.<br><br>Entretanto, os contratos de aluguel dos imóveis que compõem as carteiras dos fundos imobiliários tendem a ser de longo prazo, e os inquilinos, de alta qualidade e menos arriscados do que pessoas físicas. Bem diferente de alugar um imóvel residencial. Outro ponto importante sobre os fundos de renda com aluguel é a forma como ele é calculado. Alguns pagam um aluguel fixo, outros pagam uma pequena parte fixa e uma parte maior atrelada às receitas dos locatários.</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1330\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Agora que você já sabe o que são e como funcionam os fundos de investimentos imobiliários, é importante entender o cenário e como os FIIs voltaram a ser atrativos, a ponto de estarem entre os melhores investimentos de 2019. No auge da crise brasileira, entre 2014 e 2016, os fundos imobiliários não viveram os seus melhores momentos.<br><br>A taxa Selic vinha num ciclo de alta, o que tornava os rendimentos pagos por esse tipo de investimento menos atrativos – afinal, ficava mais difícil acompanhar a taxa básica de juros. Com a queda da inflação e da Selic, porém, os fundos imobiliários voltaram a se tornar atrativos, e suas cotas se valorizaram novamente.<br><br>Em 2018, o IFIX, indicador que faz a média das negociações de cotas dos Fundos Imobiliários brasileiros e principal benchmark do nicho, conseguiu permanecer no verde, avançando 5,6%, depois de um ano marcado pela volatilidade e incerteza por conta da greve dos caminhoneiros e, principalmente, pela eleição.<br><br>Dois fatores contribuíram para o aquecimento dos fundos imobiliários e para um crescimento muito mais significativo a partir daquele ano. A Bolsa como um todo acompanhou com bons olhos uma possível aprovação da Reforma da Previdência. E os Fundos Imobiliários embarcaram nessa mesma toada do mercado, tendo em vista dois fatores principais: Selic em patamares cada vez mais baixos e uma inflação controlada a níveis considerados bons pelos investidores.<br><br>Já que os fundos imobiliários prometem ser um dos queridinhos dos investidores brasileiros daqui para frente, abra uma conta na Genial Investimentos e aproveite para saber o melhor fundo de acordo com o seu perfil. Nossos assessores são especialistas nesse tipo de ativo e podem ajudar você a potencializar cada vez mais os seus investimentos.</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1540\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong><span style=\"background-color: rgba(255, 255, 255, 0);\">O que&nbsp;</span></strong></span></p><p style=\"line-height: 42px;\"><span style=\"background-color: rgba(255, 255, 255, 0);\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>são&nbsp;</strong><strong>Fundos&nbsp;</strong></span></span></span></p><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong><span style=\"background-color: rgba(255, 255, 255, 0);\">Imobiliários (FIIs)?</span></strong></span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-1541\"><span class=\"label\">voltar para o sumário</span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1544\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>O que são Fundos Imobiliários (FIIs)?</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1556\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong><span style=\"background-color: rgba(255, 255, 255, 0);\">Como&nbsp;</span></strong></span></p><p style=\"line-height: 42px;\"><span style=\"background-color: rgba(255, 255, 255, 0);\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>funcionam</strong></span></span></span></p><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong><span style=\"background-color: rgba(255, 255, 255, 0);\">os FIIs</span></strong></span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-1557\"><span class=\"label\">voltar para o sumário</span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1559\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>Como funcionam</strong></span><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-size: 36px;\"><br></span></span><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>os FIIs</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1579\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Como&nbsp;</strong></span></p><p style=\"line-height: 42px;\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>investir?&nbsp;</strong></span><span style=\"font-family: Rubik; font-weight: 400; font-style: normal; font-size: 48px;\">Saiba&nbsp;</span></span></p><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 400; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\">duas formas</span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-1580\"><span class=\"label\">voltar para o sumário</span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1603\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Vantagens&nbsp;</strong></span></p><p style=\"line-height: 42px;\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>dos fundos</strong></span></span></p><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>imobiliários</strong></span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-1604\"><span class=\"label\">voltar para o sumário</span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1607\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>Vantagens</strong></span><span style=\"color: rgb(61, 165, 253);\"><br><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px;\"><strong>dos fundos</strong></span><br></span><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>imobiliários</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1615\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Os principais&nbsp;</strong></span></p><p style=\"line-height: 42px;\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>tipos de fundos</strong></span></span></p><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>imobiliários</strong></span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-1616\"><span class=\"label\">voltar para o sumário</span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1619\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>Os principais tipos de fundos imobiliários</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1626\" style=\"height: auto;\"><p style=\"line-height: 42px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Mercado de&nbsp;</strong></span></p><p style=\"line-height: 42px;\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>Fundos&nbsp;</strong><strong>Imobiliários</strong></span></span></p><p style=\"line-height: 42px;\"><span style=\"color: rgb(61, 165, 253);\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px;\"><strong>volta a se&nbsp;</strong></span></span><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>aquecer</strong></span></p></div><a class=\"lp-element lp-pom-button\" id=\"lp-pom-button-1628\"><span class=\"label\">voltar para o sumário</span></a><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1629\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 36px; color: rgb(61, 165, 253);\"><strong>Mercado de Fundos Imobiliários volta a se aquecer</strong></span></p></div><div class=\"lp-element lp-pom-box\" id=\"lp-pom-box-1771\"><div id=\"lp-pom-box-1771-color-overlay\"></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1772\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Oferta&nbsp;</strong></span></p><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Pública</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1773\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 600; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); background-color: rgba(255, 255, 255, 0); font-style: normal;\">A oferta pública está presente na emissão de outros ativos conhecidos do mercado financeiro, como debêntures e os IPO’s (abertura do capital de uma empresa), que estão sujeitos a uma série de regras estabelecidas pelos órgãos reguladores.</span><span style=\"color: rgb(255, 255, 255);\"><span style=\"font-style: normal;\"><span style=\"font-weight: 600;\"><span style=\"font-family: Source Sans Pro;\"><br><span style=\"font-size: 18px; background-color: rgba(255, 255, 255, 0);\"><br>As ofertas públicas de cotas de fundos imobiliários geralmente ocorrem quando o fundo é constituído em um condomínio fechado. Antes de iniciar suas atividades, o fundo apresenta sua estratégia de investimento ao mercado e também o preço da cota e a rentabilidade esperada.</span><br><span style=\"font-size: 18px; background-color: rgba(255, 255, 255, 0);\"><br>A ideia com a oferta pública é atrair os investidores que serão os futuros cotistas. No início, o funcionamento é o seguinte: o fundo capta dinheiro dos investidores para comprar ou construir os imóveis que vão constituir a carteira.</span><br><span style=\"font-size: 18px; background-color: rgba(255, 255, 255, 0);\"><br>Depois, os investidores interessados na oferta pública têm, então, um prazo para decidir a quantia destinada ao fundo para reservar suas cotas, que são como se fossem pedaços do valor total dos imóveis. Os investidores que reservaram suas cotas receberão sua parte.</span><br></span></span></span></span><span style=\"font-weight: 600; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(255, 255, 255); background-color: rgba(255, 255, 255, 0); font-style: normal;\"><br>Terminado o período da oferta pública, o fundo fecha para a captação e a única forma de investir no fundo passa a ser por meio da compra de cotas de investidores interessados em vender. Caso o fundo precise de mais recursos no futuro, ele pode fazer novas ofertas públicas para captar mais. <br></span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div></div><div class=\"lp-element lp-pom-box\" id=\"lp-pom-box-1778\"><div id=\"lp-pom-box-1778-color-overlay\"></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1779\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>Negociação</strong></span></p><p style=\"line-height: 38px; text-align: right;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 48px; color: rgb(61, 165, 253);\"><strong>de cotas</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1780\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 600; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(225, 235, 241); background-color: rgba(255, 255, 255, 0); font-style: normal;\">Sem as ofertas públicas, a outra possibilidade de investir em um fundo imobiliário é por meio da compra e venda de cotas. Os Fundos imobiliários têm funcionamento distintos entre si, mas o padrão é ter cotas negociadas em bolsa, como se fossem ações. &nbsp;Trata-se de um mercado secundário, uma vez que não há mais ofertas públicas.</span><br><span style=\"font-weight: 600; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(225, 235, 241); background-color: rgba(255, 255, 255, 0); font-style: normal;\"><br>Para o investidor, o fato de estar na bolsa é ótimo por duas razões: liquidez, com maior facilidade de entrada e saída, além de transparência, pois há forte regulação e holofotes voltados ao negócio.</span><br><span style=\"font-weight: 600; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(225, 235, 241); background-color: rgba(255, 255, 255, 0); font-style: normal;\">&nbsp;<br>Nessa modalidade, os recursos do investidor que adquire as cotas vão para quem vendeu, e não para o fundo. Caso o fundo precise de mais recursos, ele precisará promover nova oferta pública</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div></div><div class=\"lp-element lp-pom-box\" id=\"lp-pom-box-1784\"><div id=\"lp-pom-box-1784-color-overlay\"></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1785\" style=\"height: auto;\"><p style=\"line-height: 38px;\"><span style=\"font-family: Rubik; font-weight: 500; font-style: normal; font-size: 28px; color: rgb(12, 11, 56);\"><strong>Os tipos de imóveis nos quais os fundos de renda costumam investir são:</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1786\" style=\"height: auto;\"><ul><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Shopping centers</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Um único shopping center já tem uma grande diversificação de inquilinos. O aluguel é atrelado às receitas das lojas. Períodos de vendas ruins podem afetar negativamente a rentabilidade do fundo.</span></strong></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">&nbsp;</span></strong></span></li><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Lajes Corporativas</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Em geral, imóveis de alto padrão alugados para grandes empresas. Alguns fundos investem em vários empreendimentos ou em um único empreendimento alugado para vários inquilinos. Outros investem em um único imóvel com apenas um inquilino. O aluguel, em geral, é fixo e corrigido anualmente pela inflação.&nbsp;</span></strong></span><br><br></li><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Galpões Industriais</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Em geral, de inquilino único, mas nada impede que o fundo invista em vários galpões. Podem ser ocupados, por exemplo, por centros de distribuição de grandes varejistas, indústrias e empresas de logística. O aluguel, em geral, é fixo e corrigido pela inflação.&nbsp;</span></strong></span><br><br></li><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Imóveis residenciais</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Podem ser bem diversificados, mas os inquilinos têm um pouco mais de risco, por serem pessoas físicas.&nbsp;</span></strong></span><br><br></li><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Agências bancárias</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Alugadas para bancos. Os fundos de agências bancárias em geral alugam seus imóveis para um único banco. O aluguel é fixo, apenas reajustado pela inflação.&nbsp;</span></strong></span><br><br></li><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Escolas, universidades e hospitais</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Inquilino único em fundos que, em geral, investem em imóvel único. Assim como nos shopping centers, o aluguel é condicionado à receita do locatário e pode variar.&nbsp;</span></strong></span><br><br></li><li style=\"line-height: 29px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><strong>Hotéis e Flats</strong></span></span><br><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(42, 46, 64);\"><strong><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 16px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Investem em quartos de hotel e flats (condo-hotéis). O aluguel está condicionado às receitas das unidades. Assim, podem ser afetados negativamente em momentos de crise do setor e baixa demanda por esses tipos de acomodação.&nbsp;</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></strong></span></li></ul></div></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1814\" style=\"height: auto;\"><p style=\"line-height: 31px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(12, 11, 56);\"><strong>Fundos de desenvolvimento</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1815\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os fundos de desenvolvimento são fundos imobiliários que investem na construção de imóveis para a venda. Eles lucram com a venda desses imóveis. A incorporação imobiliária é uma atividade de alto risco, e neste caso, o risco do incorporador é transferido para o investidor. Entre os problemas que podem ocorrer durante a construção estão o estouro do orçamento, problemas com licenças ambientais e atraso na entrega.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">&nbsp;<br>Por outro lado, o potencial de rentabilidade desse tipo de fundo é maior do que o dos fundos dedicados a aluguel. Fundos de desenvolvimento costumam oferecer uma renda mínima garantida aos cotistas enquanto os imóveis estão sendo construídos, para incentivá-los a permanecer no fundo.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">&nbsp;<br>Os fundos que constroem imóveis residenciais costumam vendê-los quando eles ficam prontos. Mas aqueles que constroem imóveis corporativos podem permanecer com o imóvel por certo tempo, usufruindo dos aluguéis.</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1824\" style=\"height: auto;\"><p style=\"line-height: 31px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(12, 11, 56);\"><strong>Fundos de compra e venda</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1825\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Esses fundos imobiliários tentam lucrar com a compra e venda de imóveis. A ideia é comprar as unidades quando o mercado está deprimido para vendê-los na alta. São fundos arrojados, pois seu desempenho depende das circunstâncias econômicas.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br>O rendimento desses fundos tende a ser variável. Para não ficar totalmente sem renda por longos períodos, o fundo pode combinar a estratégia de compra e venda com a estratégia de aluguel de alguns imóveis.</span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1832\" style=\"height: auto;\"><p style=\"line-height: 31px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(12, 11, 56);\"><strong>Fundos de Recebíveis imobiliários</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1833\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">São títulos de renda fixa usados para a captação de recursos para investir no mercado imobiliário. Alguns fundos imobiliários investem apenas nesse tipo de papel.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br>Os principais papéis desse tipo são os Certificados de Recebíveis Imobiliários (CRI), papéis emitidos por empresas securitizadoras para financiar empreendimentos imobiliários e transferir para os investidores o direito de receber dos futuros compradores dos imóveis.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">&nbsp;<br>Certificados de Recebíveis Imobiliários (CRI) são um instrumento para as incorporadoras e instituições financeiras anteciparem o recebimento das parcelas dos financiamentos imobiliários, transferindo para os investidores o direito de receber esses pagamentos.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br>Como outros títulos de renda fixa, CRIs prometem uma rentabilidade e têm risco de calote, isto é, de os mutuários não pagarem o que devem. A remuneração costuma estar atrelada a um índice de inflação.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">&nbsp;<br>Os CRIs têm como garantia os próprios imóveis. Mas fundos de recebíveis também podem aplicar em títulos emitidos por bancos. Nesses casos, há risco de calote do banco emissor. Por isso, ele deve ter boa saúde financeira. Esses papéis já são mais conhecidos das pessoas físicas. São as Letras de Crédito Imobiliário (LCIs) e as Letras Hipotecárias (LH), também destinadas a financiar empreendimentos imobiliários.</span><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1840\" style=\"height: auto;\"><p style=\"line-height: 31px;\"><span style=\"font-weight: 500; font-family: Rubik; font-size: 28px; color: rgb(12, 11, 56);\"><strong>Fundos de fundos</strong></span></p></div><div class=\"lp-element lp-pom-text nlh\" id=\"lp-pom-text-1841\" style=\"height: auto;\"><p style=\"line-height: 26px;\"><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\">Os fundos imobiliários que investem em outros fundos imobiliários podem ser chamados de fundos de fundos. São bastante diversificados. São vantajosos para os investidores que não querem a responsabilidade de escolher os ativos para montar uma carteira de fundos imobiliários, preferindo uma gestão profissional.</span><br><span style=\"font-weight: 400; font-family: &quot;Source Sans Pro&quot;; font-size: 18px; color: rgb(119, 119, 119); background-color: rgba(255, 255, 255, 0);\"><br>Além disso, há a vantagem de poder investir numa carteira diversificada de fundos imobiliários com um aporte bem menor do que seria necessário para aplicar em cada fundo separadamente. Como esses fundos investem em fundos de estratégias diferentes, sua remuneração costuma ser variável. O importante aqui é analisar a qualidade do gestor antes de investir.</span></p></div><div class=\"lp-element lp-pom-image\" id=\"lp-pom-image-1851\"><div class=\"lp-pom-image-container\" style=\"overflow: hidden;\"><img src=\"//d9hhrg4mnvzow.cloudfront.net/blog.genialinvestimentos.com.br/guia-fundos-imobiliarios/3715abee-marca-genial-investimentos-branco_104801q000000000000028.png\" alt=\"\" loading=\"lazy\" data-src-desktop-1x=\"//d9hhrg4mnvzow.cloudfront.net/blog.genialinvestimentos.com.br/guia-fundos-imobiliarios/3715abee-marca-genial-investimentos-branco_104801q000000000000028.png\" data-src-desktop-2x=\"//d9hhrg4mnvzow.cloudfront.net/blog.genialinvestimentos.com.br/guia